import React from 'react';
import { View, Text, Image, ScrollView, TextInput } from 'react-native'; import { StyleSheet } from 'react-native';

import './background.jpg';

const styles = StyleSheet.create({
  container: {
    flex: 1
  },
  image: {
    flex: 1,
    justifyContent: "center"
  }
});

const App = () => {
  return (
    <ScrollView>
      <ImageBackground source={'background.jpg'} resizeMode="cover" style={styles.image}>
        <Text className='text'>Some text</Text>
        <View>
          <Text>Some more text</Text>
          <Image
            source={{
              uri: 'https://reactnative.dev/docs/assets/p_cat2.png',
            }}
            style={{ width: 200, height: 200 }}
          />
        </View>
        <TextInput
          style={{
            height: 40,
            borderColor: 'gray',
            borderWidth: 1
          }}
          defaultValue="You can type in me"
        />
      </ImageBackground>
    </ScrollView>
  );
}

export default App;
